import React from 'react'
import { navigations } from '../../utils/utils'

const Navbar=()=>{
    return(
        <nav>
            {
                navigations.map((nav)=>(
                    <nav key={id}>{nav.links}</nav>
                ))
            }
        </nav>
    )
}

export default Navbar
